import React, { useState, useEffect, useContext } from 'react';
import { AuthContext } from '../../context/AuthContext';
import Card from '../Card';
import courseService from '../../services/courseService';
import { Box, Typography, CircularProgress, Alert, Paper, Table, TableBody, TableCell, TableContainer, TableHead, TableRow } from '@mui/material';

const FacultyHome = () => {
  const { user } = useContext(AuthContext);
  const [courses, setCourses] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    const fetchCourses = async () => {
      try {
        setLoading(true);
        console.log('Fetching courses for faculty ID:', user?.id);
        const response = await courseService.getCoursesByFaculty(user?.id);
        console.log('API Response:', response);
        setCourses(response.data || []);
      } catch (err) {
        console.error('Error fetching courses:', err);
        console.error('Error details:', err.response?.data || err.message);
        setError('Failed to load courses. Please try again later.');
      } finally {
        setLoading(false);
      }
    };

    if (user?.id) {
      fetchCourses();
    }
  }, [user?.id]);

  return (
    <Box sx={{ p: 2 }}>
      <Typography variant="h4" gutterBottom>Faculty Dashboard</Typography>

      <Card title={`Welcome, ${user?.name || 'Faculty'}`}>
        <Typography>You can manage your courses, mark attendance, and handle student records from this dashboard.</Typography>
      </Card>

      <Box sx={{ mt: 3 }}>
        <Card title="My Courses">
          {loading ? (
            <Box display="flex" justifyContent="center" p={2}>
              <CircularProgress />
            </Box>
          ) : error ? (
            <Alert severity="error">{error}</Alert>
          ) : courses.length === 0 ? (
            <Box>
              <Typography>No courses assigned yet.</Typography>
              <Typography variant="body2" color="textSecondary">
                Please contact the administrator to be assigned courses.
              </Typography>
              <pre style={{ marginTop: '10px', padding: '10px', backgroundColor: '#f5f5f5', borderRadius: '4px', fontSize: '12px' }}>
                Debug Info:
                User ID: {user?.id || 'Not available'}
                User Role: {user?.role || 'Not available'}
                API Response: {JSON.stringify(courses, null, 2)}
              </pre>
            </Box>
          ) : (
            <TableContainer component={Paper}>
              <Table>
                <TableHead>
                  <TableRow>
                    <TableCell><strong>Course Code</strong></TableCell>
                    <TableCell><strong>Course Name</strong></TableCell>
                    <TableCell><strong>Department</strong></TableCell>
                  </TableRow>
                </TableHead>
                <TableBody>
                  {courses.map((course) => (
                    <TableRow key={course._id}>
                      <TableCell>{course.code}</TableCell>
                      <TableCell>{course.name}</TableCell>
                      <TableCell>{course.department?.name || 'N/A'}</TableCell>
                    </TableRow>
                  ))}
                </TableBody>
              </Table>
            </TableContainer>
          )}
        </Card>
      </Box>

      <Box sx={{ mt: 3 }}>
        <Card title="Quick Actions">
          <Box sx={{ display: 'flex', gap: 2, flexWrap: 'wrap' }}>
            <Box sx={{ p: 2, border: '1px solid #e0e0e0', borderRadius: 1, minWidth: '200px' }}>
              <Typography variant="h6">Mark Attendance</Typography>
              <Typography variant="body2">Take attendance for your courses</Typography>
            </Box>
            <Box sx={{ p: 2, border: '1px solid #e0e0e0', borderRadius: 1, minWidth: '200px' }}>
              <Typography variant="h6">Enter Marks</Typography>
              <Typography variant="body2">Update student marks and grades</Typography>
            </Box>
            <Box sx={{ p: 2, border: '1px solid #e0e0e0', borderRadius: 1, minWidth: '200px' }}>
              <Typography variant="h6">Leave Requests</Typography>
              <Typography variant="body2">Manage your leave applications</Typography>
            </Box>
          </Box>
        </Card>
      </Box>
    </Box>
  );
};

export default FacultyHome;
